import React, { Component } from 'react';
import { FormattedMessage } from 'react-intl';
import { connect } from 'react-redux';
import { Button,Modal,ModalBody, ModalFooter, ModalHeader } from 'reactstrap';
class ModalUser extends Component {
    constructor(props){
        super(props);
        this.state={

        }
    }

    componentDidMount() {
    }
    toggle = () =>{
        this.props.toggleFromParent();
    }

    render() {
        return (
            <Modal 
                isOpen = {this.props.isOpen} 
                toggle={() => {this.toggle()}} 
                className={'abcclassName'}
                size='md'
                centered
                >
                <ModalHeader toggle={() => {this.toggle()}}> CREATE NEW USER </ModalHeader>
                <ModalBody>
                <div class="row">
                    <form action="/post-crud" method="POST">
                        <div class="form-row">
                            <div class="form-group col-md-12">
                                <label for="inputEmail4">Email</label>
                                <input type="email" class="form-control" placeholder="Email" name="email"></input>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputPassword4">Password</label>
                                <input type="password" class="form-control" name="password" placeholder="Password"></input>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputEmail4">FirstName</label>
                                <input type="text" class="form-control" placeholder="FirstName" name="firstname"></input>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputPassword4">Last Name</label>
                                <input type="text" class="form-control" name="lastname" placeholder="lastname"></input>
                            </div>
                            <div class="form-group">
                                <label for="inputAddress">Address</label>
                                <input type="text" class="form-control" name="address" placeholder="1234 Main St"></input>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputCity">Phone number</label>
                                <input type="text" class="form-control" name="phonenumber"></input>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputState">Sex</label>
                                <select name="gender" class="form-control">
                                <option value="1">Male</option>
                                <option value="0">Female</option>
                                </select>
                            </div>
                            <div class="form-group col-md-12">
                                <label for="inputZip">Role</label>
                                <select name="roleId" class="form-control">
                                    <option value="1">Admin</option>
                                    <option value="2">Doctor</option>
                                    <option value="3">Patient</option>
                                </select>
                            </div>
                        </div>
                        <div class="form-row">
                        </div>
                        <button type="submit" class="btn btn-primary">Sign in</button>
                    </form>
                </div>
                </ModalBody>
                <ModalFooter>
                    <Button color='primary' onClick={() => {this.toggle()}}>Add User</Button>
                    <Button color='secondary' onClick={() => {this.toggle()}}>Cancel</Button>
                </ModalFooter>
            </Modal>
        )
    }

}

const mapStateToProps = state => {
    return {
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(ModalUser);
